import styled from "styled-components";
import StoreItem from "./StoreItem";
import StoresByType from "./StoresByType";

const StoresOverview = (props) => {
    const infoType = ["명소", "카페", "음식점", "놀거리"];


    return (
        <Container>
            {infoType.map((type, index) => {
                return <div>
                        <StoresByType type={type}/>
                        {
                            infoType.length !== index+1 &&
                            <Divider />
                        }
                    </div>
            })}
        </Container>
    );
}

const Container = styled.div`
    margin-left: 20px;
    margin-top: 30px;
`;

const Divider = styled.div`
    width: 100%;
    height: 2px;
    background-color: #61677A; // 원하는 색상으로 변경
    margin: 13px 0 13px; // 원하는 마진으로 변경
`;

export default StoresOverview;
